import React, { Component } from 'react';
import Navigationbar from "./Components/Navigationbar.js";

import './App.css';

class App extends Component {
	state = {
	};

	render() {
		return (
		<React.Fragment>
		<main>
			<Navigationbar/>
			<h1>Welcome to TempusReality</h1>
			<img
					src=".\Components\images\tempuslogo.png"
					height="40"
					width="50"
					className="m-2"
					alt="Company Logo"
			/>
		</main>
		</React.Fragment>
		);
	}
}

export default App;
